import './App.css';
import { fruits } from './fruits.json';

function App() {
  return (
    <div className="App">
      <input placeholder='search...' type='text' className='search' />
      <ul>
        {fruits.map(fruit=>`~`)}
        <li className='listItem'>Lemon</li>
        <li className='listItem'>Apple</li>
        <li className='listItem'>Peach</li>
      </ul>
    </div>
  );
}

export default App;
